script: |
  super -f text -I q874.spq | sort > q874.out

inputs:
  - name: q874.spq
    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) WHERE NOT NULL NOT BETWEEN CAST ( - col1 AS INTEGER ) AND col0 * 74 - + col1 + - col2 / + 13 / - 94;
  - name: tab2

outputs:
  - name: q874.out
    data: |
